import React from 'react';
import { MDBInput, MDBFormInline, MDBBtn, MDBIcon } from 'mdbreact';

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
    this.addProduct = this.addProduct.bind(this);
  }
  addProduct = () => {
    // e.preventDefault();
    let productForm = this.refs.productForm;
    if (productForm.checkValidity() === false) {
      productForm.classList.add('was-validated');
    }
    else {
      console.log('login bnt ok' + this.state.username + '' + this.state.password)
      // this.setState({ isLoggedIn: true })
      // this.props.history.push('/home')
      // this.saveToServer();
    }
  }

  render() {

    return (
      <div className="mb-4" style={{ marginTop: '70px' }}>

        <h2 className="h1-responsive text-center my-4">Order management</h2>
        <form ref='mainForm'>
          <MDBFormInline ref='orderForm'>
            <div className=' p-0' >
              <label className='form-control' style={{ fontWeight: 'bold', textAlign: 'left' }}>Order:</label>
            </div>
            <MDBInput style={{ marginRight: '4px' }} label="Id" outline disabled />
            <MDBInput style={{ marginRight: '4px' }} label="Source" outline />
            <MDBInput style={{ marginRight: '4px' }} label="Status" outline />
            <MDBInput style={{ marginRight: '4px' }} label="Tracking Id" name="orderTracking" onInput={this.handleInput} outline />
            <MDBInput style={{ marginRight: '4px' }} label="Total" outline disabled />
          </MDBFormInline>
          <MDBFormInline ref='customerForm'>
            <div className=' p-0' >
              <label className='form-control' style={{ fontWeight: 'bold', textAlign: 'left' }}>Customer:</label>
            </div>
            <MDBInput style={{ marginRight: '4px' }} label="Name" name="cName" onInput={this.handleInput} required validate outline />
            <MDBInput style={{ marginRight: '4px' }} label="Contact" name="cContact" onInput={this.handleInput} required validate outline />
            <MDBInput style={{ marginRight: '4px' }} label="Address" name="cAddress" onInput={this.handleInput} required validate outline />
            <MDBInput style={{ marginRight: '4px' }} label="Total value added" outline disabled />
          </MDBFormInline>
          <MDBFormInline ref='productForm'>
            <div className='p-0' >
              <label className='form-control' style={{ fontWeight: 'bold', textAlign: 'left' }}>Product:</label>
            </div>
            <MDBInput style={{ marginRight: '4px' }} type='text' label="Name" outline required />
            <MDBInput style={{ marginRight: '4px' }} type='text' label="SKU" outline />
            <MDBInput style={{ marginRight: '4px' }} type='number' label="Rate" outline min='0' />
            <MDBInput style={{ marginRight: '4px' }} type='number' label="Qty" outline />
            <MDBInput style={{ marginRight: '4px' }} type='number' label="Price" outline />
            <MDBInput style={{ marginRight: '4px' }} type='text' label="Remarks" outline />
            <MDBInput type='checkbox' filled label='Is Extra added?' />
            <MDBBtn onClick={this.addProduct} size='lg' style={{ width: '50px', height: '40px', padding: '0px' }} outline>Add</MDBBtn>
          </MDBFormInline>
        </form>

      </div>
    );
  }
}

export default Home;
